import React from "react";
import Box from '@mui/material/Box';
import Header from "../../components/Header/header";
import Cartlist from "../../components/Cartlist/Cartlist";
import {getCart} from '../../Services/dataservice'
import { OneKPlusOutlined } from "@mui/icons-material";
import { Grid,Paper,Typography,Card } from "@mui/material";
import FormControl from '@mui/material/FormControl';
import MenuItem from '@mui/material/MenuItem';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';


function Cart(){
    const [bookCart,setBookCart]=React.useState([])


    const getBooksFromCart=(data)=>{
        getCart().then((response)=>{

                setBookCart(response.data.result)

            }).catch((error)=>{

                console.log(error)

            })

        }
        React.useEffect(()=>{
            //console.log(getBook)
            getBooksFromCart()

        },[])






    return(
        <Box sx={{
            width:'100vw',
            height:'100vh',
            display:'flex',
            flexDirection:'column',
            alignItems:'center'

        }}>
            <Box>
                <Header/>
            </Box>
            <Box sx={{
                     display:'flex',
                     flexDirection:'row',
                     position:'relative',
                     top:30,
                     border:'1px solid red',
                     width:'80%',
                     marginBottom:5,

                 }}>
            <Typography  sx={{ position:'relative',
                    left:100,}}> My Cart</Typography>
            <Box  sx={{width:'50%',
                    height:'100%',


                    display:'flex',
                    flexDirection:'column'}}>

                        <Box sx={{ width: '60%',position:'relative',left:800
                        }}>
                            <FormControl sx={{width:'65%'}}>
                                <InputLabel id="demo-simple-select-label">location</InputLabel>
                                <Select

                                >
                                <MenuItem value={10}>Ten</MenuItem>
                                <MenuItem value={20}>Twenty</MenuItem>
                                <MenuItem value={30}>Thirty</MenuItem>
                                </Select>
                            </FormControl>
                            </Box>

                    </Box>
            </Box>
            <Paper sx={{
                 width:'80%',
                display:'flex',
                flexDirection:'column',
                border:'1px solid green',
                height:100
            }}>




            </Paper>
            <Card sx={{

                    width:'80%',
                    height:80,

                    position:'relative',
                    left:5,top:10}}
                >
                    <Typography sx={{display:'flex',justifyContent:'flex-start',
                     postion:'absolute',left:100,top:100,}}>
                        Address Details
                    </Typography>
                </Card>



        </Box>
        )

}


export default Cart
